import React from "react";

const Progressbar = (props) => {
  return (
    <div className={props.className}>
      <h3>{props.title}</h3>
      <div className="years">
        <span>Années d'expérience</span>
        <span>1 an</span>
        <span>2 an</span>
      </div>
      <div>
          {
              props.languages.map()
          }
      </div>
    </div>
  );
};

export default Progressbar;
